import React, { useEffect, useState } from 'react'
import { useDispatch } from 'react-redux'
import './AdminUser.css'
import { getAllEmplyees } from '../../../actions/adminActions';

const AdminUserPage = () => {
    const dispatch = useDispatch();

    const [ed, setEd] = useState('');

    useEffect(() => {
        dispatch(getAllEmplyees())
    }, [])

  return (
    <div className='adminUserPage' >
    <div className="adminUserPage-box">
    <div className="top">
            <button onClick={() => setEd("employee")} >Employees</button>
            <button onClick={() => setEd("employer")}>Employers</button>
            <button onClick={() => setEd("block")}>Blocked Users</button>
            <button onClick={() => setEd("black")}>Blacklisted</button>
        </div>

        <div className="bottom">
        {ed === "edPopup" ? (
        <EducationPopup />
      ) : ed === "langPopup" ? (
        <LanguagePopup />
      ) : ed === "skillPopup" ? (
        <SkillsPopup />
      ) : ed === "infoPopup" ? (
        <InfoPopup />
      ) : ed === "imgPopup" ? (
        <ImagePopup />
      ) : ed === "kycPopup" ? (
        <KycPopup />
      ) : ed === "bankPopup" ? (
        <BankPopup bankData={userData?.bankDetails} />
      ) : ed == "portfoilioPopup" ? (
        <PortfoilioPopup />
      ) : ed == "changePasswordPopup" ? (
        <ChangePasswordPopup />
      ) : (
        ""
      )}
        </div>
    </div>
        
    </div>
  )
}

export default AdminUserPage
